impl Solution {
    pub fn number_of_powerful_int(start: i64, finish: i64, limit: i32, s: String) -> i64 {
        let mut count = 0;
        let s_len = s.len() as i64;
        let mut num = s.parse::<i64>().unwrap();

        // Ensure the suffix is within the start-finish range.
        if num < start || num > finish {
            return 0;
        }

        count += 1; // Count the suffix itself if it's in range.
        let mut prefix = 1;

        loop {
            num = format!("{}{}", prefix, s).parse::<i64>().unwrap();
            if num > finish {
                break;
            }
            if num >= start && num <= finish && prefix.to_string().chars().all(|c| c.to_digit(10).unwrap() <= limit as u32) {
                count += 1;
            }
            prefix += 1;
            if prefix.to_string().len() as i64 > s_len || prefix > 10_i64.pow(limit as u32) {
                break;
            }
        }

        count
    }
}
